import React from "react";
import { Link } from "react-router-dom";
import "./Contact.css";
import { FaIdBadge } from "react-icons/fa";

const Contact = () => {
  return (
    <div className="contact-page-container">
      <section className="contacts-container">
        <h1>We'd Love to Hear From You</h1>
        <div className="contact-details">
          <section className="contact-means">
            <FaIdBadge/>
          <h3> Contact us </h3>
            <li> <Link to="/"> 004917581005650 </Link> </li>
            <li> <Link to="/"> uelandrae@gamil.com </Link> </li>
          </section>

          <section className="contact-means">
            <h3> Come See Us </h3>
            <li> <Link to="/"> Pinneberg, Germany </Link> </li>
            <li> <Link to="/"> Hamburg, Germany </Link> </li>
          </section>

          <section className="contact-means">
            <h3>24/7 Support</h3>
            <li> <Link to="/"> Open a support case </Link> </li>
            <li> <Link to="/"> Call us now </Link> </li>
          </section>
        </div>
      </section>
    </div>
  );
};

export default Contact;
